class BinaryParserNew {
	constructor(buffer) {
		this.view = new DataView(buffer);
		this.offset = 0;
	}

	/* Helpers */

	increment(inc) {
		// increment offset without leaving the bounds
		this.offset = Math.min(this.offset + inc, this.view.byteLength - 1);
	}

    // returns Uint8Array with padding bytes
	readFixedBytes(len) {
        if (len == 0) { return new Uint8Array(); }

        this.increment(len);
		return new Uint8Array(this.view.buffer.slice(this.offset - len, this.offset));
	}

	/* Primitives */

	readUint8() {
		let value = this.view.getUint8(this.offset);
        this.increment(1);

		return value;
	}

	readUint16() {
		let value = this.view.getUint16(this.offset, false);
        this.increment(2);

		return value;
	}

	readUint32() {
		let value = this.view.getUint32(this.offset, false);
        this.increment(4);

		return value;
	}

    readUint64() {
        let value = this.view.getUint64(this.offset, false);
        this.increment(8);

        return value;
    }

	readFloat() {
		let value = this.view.getFloat32(this.offset, false);
        this.increment(4);

		return value;
	}

    readDouble() {
        let value = this.view.getFloat64(this.offset, false);
        this.increment(8);

        return value;
    }

	/* Photon Types */

    // 0x44 (Dictionary)
    parseDictionary() {
        let keyType = this.readUint8();
        let valType = this.readUint8();
        let len = this.readUint16();

        let readKey = keyType == 0 || keyType == 0x2A;
        let readVal = valType == 0 || valType == 0x2A;

        let map = new Map();

        for (let i = 0; i < len; i++) {
            let key = this.parsePhotonType(readKey ? null : keyType);
            let val = this.parsePhotonType(readVal ? null : valType);

            if (key.data != null) {
                map.set(key, val);
            }
        }

        return map;
    }

    // 0x61 (StringArray)
    parseStringArray() {
        let len = this.readUint16();
        let strings = [];

        for (let i = 0; i < len; i++) {
            strings.push(this.parseString());
        }

        return strings;
    }

    // 0x62 (Byte)
    parseByte() {
        return this.readUint8();
    }

    // 0x63 (CustomData)
    parseCustomData() {
        var variant = String.fromCharCode(this.readUint8());
        var len = this.readUint16();
        var data = null;

        switch (variant) {
            case 'W': data = this.parseVec2(); break;
            case 'V': data = this.parseVec3(); break;
            case 'Q': data = this.parseQuat(); break;
            case 'P': data = this.parsePhotonPlayer(); break;
            default: data = this.parseUnknownCustom();
        }

        return { variant, data };
    }

    // 0x63 (CustomData), "W" (Vec2)
    parseVec2() {
        return {
            x: this.readFloat(),
            y: this.readFloat(),
        };
    }

    // 0x63 (CustomData), "V" (Vec3)
    parseVec3() {
        return {
            x: this.readFloat(),
            y: this.readFloat(),
            z: this.readFloat(),
        };
    }

    // 0x63 (CustomData), "Q" (Quat)
    parseQuat() {
        return {
            w: this.readFloat(),
            x: this.readFloat(),
            y: this.readFloat(),
            z: this.readFloat(),
        };
    }

    // 0x63 (CustomData), "P" (PhotonPlayer)
    parsePhotonPlayer() {
        return {
            player_id: this.readUint32(),
        }
    }

    // 0x63 (CustomData), unknown
    parseUnknownCustom(len) {
        return {
            data: this.readFixedBytes(len),
        }
    }

    // 0x64 (Double)
    parseDouble() {
        return this.readDouble();
    }

    // 0x65 (EventData)

    // 0x66 (Float)
    parseFloat() {
        return this.readFloat();
    }

    // 0x68 (HashTable)
    parseHashTable() {
        let len = this.readUint16();

        let map = new Map();

        for (let i = 0; i < len; i++) {
            let key = this.parsePhotonType();
            let val = this.parsePhotonType();

            if (key.data != null) {
                map.set(key, val);
            }
        }

        return map;
    }

    // 0x69 (Integer)
    parseInteger() {
        return this.readUint32();
    }

    // 0x6B (Short)
    parseShort() {
        return this.readUint16();
    }

    // 0x6C (Long)
    parseLong() {
        return this.readUint64();
    }

    // 0x6E (IntArray)
    parseIntArray() {
        let len = this.readUint32();
        let ints = []

        for (let i = 0; i < len; i++) {
            ints.push(this.readUint32());
        }

        return ints;
    }

    // 0x6F (Boolean)
    parseBool() {
        return !!this.readUint8();
    }

    // 0x70 (OpResponse)

    // 0x71 (OpRequest)

    // 0x73 (String)
    parseString() {
        let len = this.readUint16();
        let decoder = new TextDecoder();

        return decoder.decode(this.readFixedBytes(len));
    }

    // 0x78 (ByteArray)
    parseByteArray() {
        let len = this.readUint32();
        return this.readFixedBytes(len);
    }

    // 0x79 (Array)
    parseArray() {
        let len = this.readUint16();
        let type = this.readUint8();
        let arr = [];

        for (let i = 0; i < len; i++) {
            arr.push(this.parsePhotonType(type));
        }

        return arr;
    }

    // 0x7A (ObjectArray)
    parseObjectArray() {
        let len = this.readUint16();
        let arr = [];

        for (let i = 0; i < len; i++) {
            arr.push(this.parsePhotonType());
        }

        return arr;
    }

    /* Logic */

    parsePhotonType(forceType = null) {
        let type = forceType ?? this.readUint8();
        var data = null;
        switch (type) {
            case 0x2A:
                data = null; break;
            case 0x44:
                data = this.parseDictionary(); break;
            case 0x61:
                data = this.parseStringArray(); break;
            case 0x62:
                data = this.parseByte(); break;
            case 0x63:
                data = this.parseCustomData(); break;
            case 0x64:
                data = this.parseDouble(); break;
            case 0x66:
                data = this.parseFloat(); break;
            case 0x68:
                data = this.parseHashTable(); break;
            case 0x69:
                data = this.parseInteger(); break;
            case 0x6B:
                data = this.parseShort(); break;
            case 0x6C:
                data = this.parseLong(); break;
            case 0x6E:
                data = this.parseIntArray(); break;
            case 0x6F:
                data = this.parseBool(); break;
            case 0x73:
                data = this.parseString(); break;
            case 0x78:
                data = this.parseByteArray(); break;
            case 0x79:
                data = this.parseArray(); break;
            case 0x7A:
                data = this.parseObjectArray(); break;
            default:
                console.warn("Photon Parser: Unknown type '%d'", type);
        }

        return { type, data };
    }
}

