class BinarySerializer2 {
    constructor() {
        this.byteArray = [];
    }

    pushBytes(bytes) {
        this.byteArray.push(...bytes);
    }

    serializeUint8(value) {
        this.pushBytes([value]);
    }

    serializeUint16(value) {
        let buffer = new ArrayBuffer(2);
        new DataView(buffer).setUint16(0, value, false);
        this.pushBytes(new Uint8Array(buffer));
    }

    serializeBytes(data) {
        this.serializeUint32(data.length);
        this.pushBytes(data);
    }

    serializeUint32(value) {
        let buffer = new ArrayBuffer(4);
        new DataView(buffer).setUint32(0, value, false);
        this.pushBytes(new Uint8Array(buffer));
    }

    serializeFloat32(value) {
        let buffer = new ArrayBuffer(4);
        new DataView(buffer).setFloat32(0, value, false);
        this.pushBytes(new Uint8Array(buffer));
    }

    serializePadding(data) {
        this.pushBytes(data);
    }

    serializeVec3(vec3) {
        this.serializeFloat32(vec3.x);
        this.serializeFloat32(vec3.y);
        this.serializeFloat32(vec3.z);
    }

    serializeQuat(quat) {
        this.serializeFloat32(quat.w);
        this.serializeFloat32(quat.x);
        this.serializeFloat32(quat.y);
        this.serializeFloat32(quat.z);
    }

    serializeString(str) {
        let encoder = new TextEncoder();
        let bytes = encoder.encode(str);
        this.serializeUint16(bytes.length);
        this.pushBytes(bytes);
    }

    serializeArray(array) {
        this.serializeUint16(array.length);
        if (array.length > 0) {
            this.serializeUint8(array[0].dataType);
        }
        array.forEach(item => {
            switch (item.dataType) {
                case 0x62: this.serializeUint8(item.data); break;
                case 0x69: this.serializeUint32(item.data); break;
                case 0x6B: this.serializeUint16(item.data); break;
                case 0x6F: this.serializeUint8(item.data ? 1 : 0); break;
                case 0x73: this.serializeString(item.data); break;
                case 0x66: this.serializeFloat32(item.data); break;
                case 0x2A: break;
                default: console.warn("Unknown array data type: " + item.dataType);
            }
        });
    }

    serializeObject(object) {
        this.serializeUint8(object.type);

        switch (object.type) {
            case 0x62: this.serializeUint8(object.data); break;
            case 0x69: this.serializeUint32(object.data); break;
            case 0x6B: this.serializeUint16(object.data); break;
            case 0x6F: this.serializeUint8(object.data ? 1 : 0); break;
            case 0x73: this.serializeString(object.data); break;
            case 0x66: this.serializeFloat32(object.data); break;
            case 0x79: this.serializeArray(object.data); break;
            case 0x63:
                this.serializeUint8(object.variant.charCodeAt(0));
                this.serializeUint16(object.len);
                if (object.variant === 'V') {
                    this.serializeVec3(object.data);
                } else if (object.variant === 'Q') {
                    this.serializeQuat(object.data);
                }
                break;
            case 0x7A:
                this.serializeUint16(object.objects.length);
                object.objects.forEach(obj => this.serializeObject(obj));
                break;
            case 0x78:
                this.serializeBytes(object.data);
            break;
            case 0x2A:
                break;
            default:
                console.warn("Unknown object type: " + object.type);
        }
    }

    getSerializedData() {
        return new Uint8Array(this.byteArray);
    }
}

class BinarySerializer {
    constructor() {
        this.byteArray = [];
    }

    pushBytes(bytes) {
        this.byteArray.push(...bytes);
    }

    serializeUint8(value) {
        this.pushBytes([value]);
    }

    serializeUint16(value) {
        let buffer = new ArrayBuffer(2);
        new DataView(buffer).setUint16(0, value, false); // Big-endian
        this.pushBytes(new Uint8Array(buffer));
    }

    serializeUint32(value) {
        let buffer = new ArrayBuffer(4);
        new DataView(buffer).setUint32(0, value, false); // Big-endian
        this.pushBytes(new Uint8Array(buffer));
    }

    serializeFloat32(value) {
        let buffer = new ArrayBuffer(4);
        new DataView(buffer).setFloat32(0, value, false); // Big-endian
        this.pushBytes(new Uint8Array(buffer));
    }

    serializePadding(data) {
        this.pushBytes(data);
    }

    serializeVec3(vec3) {
        this.serializeFloat32(vec3.x);
        this.serializeFloat32(vec3.y);
        this.serializeFloat32(vec3.z);
    }

    serializeQuat(quat) {
        this.serializeFloat32(quat.w);
        this.serializeFloat32(quat.x);
        this.serializeFloat32(quat.y);
        this.serializeFloat32(quat.z);
    }

    serializeObject(object) {
        this.serializeUint8(object.type);

        switch (object.type) {
            case 0x62: // u8
                this.serializeUint8(object.data);
                break;
            case 0x69: // s32
                this.serializeUint32(object.data);
                break;
            case 0x6B: // s16
                this.serializeUint16(object.data);
                break;
            case 0x6F: // bool
                this.serializeUint8(object.data ? 1 : 0);
                break;
            case 0x63: // variant object
                this.serializeUint8(object.variant.charCodeAt(0));
                this.serializeUint16(object.len);
                if (object.variant === 'V') {
                    this.serializeVec3(object.data);
                } else if (object.variant === 'Q') {
                    this.serializeQuat(object.data);
                }
                break;
            case 0x7A: // array of objects
                this.serializeUint16(object.objects.length);
                object.objects.forEach(obj => this.serializeObject(obj));
                break;
            case 0x2A: // empty object
                break;
            default:
                console.warn("Unknown object type: " + object.type);
                break;
        }
    }

    getSerializedData() {
        return new Uint8Array(this.byteArray);
    }
}

class BinaryParser {
    constructor(buffer) {
        this.view = new DataView(buffer);
        this.offset = 0;
    }

    readUint8() {
        return this.view.getUint8(this.offset++);
    }

    readUint16() {
        let value = this.view.getUint16(this.offset, false);
        this.offset += 2;
        return value;
    }

    readUint32() {
        let value = this.view.getUint32(this.offset, false);
        this.offset += 4;
        return value;
    }

    readFloat32() {
        let value = this.view.getFloat32(this.offset, false);
        this.offset += 4;
        return value;
    }

    readPadding(bytes) {
        let value = new Uint8Array(bytes);
        for (let i = 0; i < bytes; i++) {
            value[i] = this.readUint8();
        }
        return value;
    }

    readVec3() {
        return {
            x: this.readFloat32(),
            y: this.readFloat32(),
            z: this.readFloat32(),
        };
    }

    readQuat() {
        return {
            w: this.readFloat32(),
            x: this.readFloat32(),
            y: this.readFloat32(),
            z: this.readFloat32(),
        };
    }

    readObject() {
        let type = this.readUint8();
        switch (type) {
            case 0x62: return { type, data: this.readUint8() };
            case 0x69: return { type, data: this.readUint32() };
            case 0x6B: return { type, data: this.readUint16() };
            case 0x6F: return { type, data: !!this.readUint8() };
            case 0x63:
                var variant = String.fromCharCode(this.readUint8());
                var len = this.readUint16();
                return {
                    type,
                    variant,
                    len,
                    data: variant === 'V' ? this.readVec3() : this.readQuat()
                };
            case 0x7A:
                var length = this.readUint16();
                var objects = [];
                for (let i = 0; i < length; i++) {
                    objects.push(this.readObject());
                }
                return { type, objects };
            case 0x2A:
                return { type, data: null };
            default:
                return { type, data: null };
        }
    }
}


