// Function to modify the w component in the original Base64 string
function modifyBase64WithRandomW(originalBase64) {
  const wRegex = /([A-Za-z0-9+/=]+)(AAABjVgAMu8Y\+DEdKU95HWym8Y1EAED\+AAAAAAAAAAAAAAAAAAABiAGmL\/)([A-Za-z0-9+/=]+)/;
  const randomW = generateRandomW();

  // Convert the random w to a string and ensure it is Base64-safe
  const wBase64 = btoa(encodeURIComponent(randomW.toString()));

  // Replace the w part in the Base64 string
  const modifiedBase64 = originalBase64.replace(wRegex, `$1${wBase64}$3`);

  return modifiedBase64;
}

