    removePlayerFromRoom = function (player) {
        player = parseColorTags(player);
        if (playerList.includes(player)) {
            playerList = playerList.filter((p) => p !== player);

            const playerItems = document.querySelectorAll(".player-item");
            playerItems.forEach((item) => {
                if (item.textContent === player) {
                    item.remove();
                }
            });

            if (selectedPlayerName === player) {
                selectedPlayerName = null;
                console.log(`Player ${player} was removed. No player is currently selected.`);
            }
        }
    };

