    const reFetchButton = uiManager.createButton("Re-Fetch Account Data", async () => {
        if (savedRequestUrl && savedRequestInit) {
            try {
                Log.info("Re-fetching account data...");
                const response = await fetch(savedRequestUrl, savedRequestInit);

                const responseClone = response.clone();

                const responseBody = await responseClone.text();
                const parts = responseBody.split('%%fieldSeparator%%');
                let jsonString = parts[2];

                jsonString = jsonString.trim();
                if (!jsonString.startsWith('{') || !jsonString.endsWith('}')) {
                    throw new Error('Invalid JSON string format');
                }

                let bfAccountInfo = JSON.parse(jsonString).bfAccountInfo;

                if (bfAccountInfo) {
                    money = bfAccountInfo.money || 0;
                    xp = bfAccountInfo.xp || 0;
                    tDeaths = bfAccountInfo.tDeaths || 0;
                    mWon = bfAccountInfo.mWon || 0;
                    mLost = bfAccountInfo.mLost || 0;
                    tKills = bfAccountInfo.tKills || 0;
                    knifeKills = bfAccountInfo.knifeKills || 0;
                    highStrk = bfAccountInfo.highStrk || 0;
                    mostKills = bfAccountInfo.mostKills || 0;
                }

                updateAccountLabels();
                Log.info("Account data successfully re-fetched!");
            } catch (error) {
                console.error("Error re-fetching account data:", error);
                uiManager.createNotification(
                    "Re-Fetch Failed",
                    "https://www.google.com/s2/favicons?sz=64&domain=crazygames.com",
                    "Failed to re-fetch account data."
                );
            }
        } else {
            Log.warn("No saved request found for re-fetching.");
            uiManager.createNotification(
                "Re-Fetch Failed",
                "https://www.google.com/s2/favicons?sz=64&domain=crazygames.com",
                "No saved fetch request available."
            );
        }
    });

