        function saveBase64MessagesToFile() {
            const messages = window.allSocketMessages.map(argandMessage =>
                                                          btoa(argandMessage) // Encode in Base64
                                                         ).join("\n"); // Separate messages by new line

            const blob = new Blob([messages], { type: "text/plain" });
            const url = URL.createObjectURL(blob);

            // Save the URL for downloading
            window.lastEncodedFileUrl = url;
        }

        function downloadEncodedFile(filename = "encoded_messages.txt") {
            if (!window.lastEncodedFileUrl) {
                console.error("No encoded file available. Call saveBase64MessagesToFile() first.");
                return;
            }

            const a = document.createElement("a");
            a.href = window.lastEncodedFileUrl;
            a.download = filename;
            document.body.appendChild(a);
            a.click();
            document.body.removeChild(a);

            // Cleanup
            URL.revokeObjectURL(window.lastEncodedFileUrl);
            window.lastEncodedFileUrl = null;
        }

